    Sign On Capabilities. Federated identity management (or identity federation) enables
    enterprises to exchange identity information securely across Internet domains, providing
    secure SSO. Federation is also used to integrate access to applications across distinct
    business units within a single organization. It enables Integrated Windows Authentication
